import TextEditor from './components/text-editor';

const App = () => {
  return (
    /*
    <Provider store={store}>
      <div>
        <TextEditor />
      </div>
    </Provider>
    */
    <div>
    <TextEditor />
    <CodeCell />
    </div>
    
  );
};

ReactDOM.render(<App />, document.querySelector('#root'));
